import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: "center",
    justifyContent: "center"
  },
  scrollView: {
    flex: 1
  },
  inputContainer: {},
  inputLabel: {
    fontSize: 16,
    lineHeight: 23.17,
    color: "#000000"
  },
  inputText: {
    alignItems: "center",
    padding: 8,
    width: 312,
    borderBottomWidth: 1,
    borderColor: "#000000"
  }
});

export default styles;
